import StudentForm from "./studentForm.js";
import { BrowserRouter as Routers,Routes,Route, Link } from "react-router-dom";
function App(){
    return(
        <Routers>
            <h1>Student Registration Gtyde technology</h1>
            <Routes>
            
            <Route path="/" element={<StudentForm/>}/>
            </Routes>
        </Routers>
    )
}
export default App;
